webpackJsonp([6027254986088],{5956:function(t,e){t.exports={data:{post:{html:"<p>I'm still not in the swing of things. Mama had an early meeting this morning, so I was to take Christopher this morning, However,  I overslept by a full 2 hours, which of course wreacked total havoc on our tight weekday schedule.</p>\n<p>At least, thanks to Easter Monday, it's a short 4-day work week. So is next week, thanks to May Day. One can get used to 4-day weeks rather quickly. I think I say that every year at Easter.</p>",fields:{title:"What Time Is It?",date:"24 Apr 2003",url:"https://papascott.de/2003-04-24-what-time-is-it/"}}},pathContext:{slug:"/2003-04-24-what-time-is-it/",prev:{fields:{title:"Schill and Al Queda?",date:"24 Apr 2003",slug:"/2003-04-24-schill-and-al-queda/"}},next:{fields:{title:"Every little bit burns",date:"25 Apr 2003",slug:"/2003-04-25-every-little-bit-burns/"}}}}}});
